window.bookSummaryJSON = "<p>Not long ago, Daniel Mahan, known to everyone as Shaman Mahan, thought that he had taken his sixth and final step in the Barliona gameworld. Yet life has other ideas. The Corporation decides to resurrect the Lord of Shadow and his entire host. The Corporation's CEO personally pushes the reset button. Geranika and his Dragon of Shadow spring back to life as, meanwhile, the Corporation makes an offer the Shaman can't refuse.</p>"; 
